import { SafeUrl } from '@angular/platform-browser';

export class VehicleImage {
  imageId: number = 0;
  imageType:string = "";
  imageName: string = "";
  vehicleId: number = 0;
  image: string = "";
  imageUrl: SafeUrl;
}
